import { ifDefined } from "lit-html/directives/if-defined.js";
import { html, svg, repeat, classMap, styleMap, unsafeHTML, scopeTag } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';

const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<section class="ui5-carousel-root" tabindex="0" role="listbox" aria-activedescendant="${ifDefined(context.ariaActiveDescendant)}" @keydown=${context._onkeydown} @mouseout="${context._onmouseout}" @mouseover="${context._onmouseover}"><div class="${classMap(context.classes.viewport)}"><div class="${classMap(context.classes.content)}" style="${styleMap(context.styles.content)}">${ repeat(context.items, (item, index) => item._id || index, (item, index) => block1(item, index, context)) }</div></div>${ context.arrows.content ? block2(context) : undefined }${ context.renderNavigation ? block3(context) : undefined }</div></section> `; };
const block1 = (item, index, context) => { return html`<div id="${ifDefined(item.id)}" class="ui5-carousel-item ${ifDefined(item.classes)}" style="width: ${ifDefined(item.width)}px;" role="option" aria-posinset="${ifDefined(item.posinset)}" aria-setsize="${ifDefined(item.setsize)}"><slot name="${ifDefined(item.item._individualSlot)}" tabindex="${ifDefined(item.tabIndex)}"></slot></div>`; };
const block2 = (context) => { return html`<div class="ui5-carousel-navigation-arrows"><${scopeTag("ui5-button", tags, suffix)} arrow-back title="${ifDefined(context.previousPageText)}" class="ui5-carousel-navigation-button ${classMap(context.classes.navPrevButton)}" icon="slim-arrow-left" tabindex="-1" @click=${context.navigateLeft}></${scopeTag("ui5-button", tags, suffix)}><${scopeTag("ui5-button", tags, suffix)} arrow-forward title="${ifDefined(context.nextPageText)}" class="ui5-carousel-navigation-button ${classMap(context.classes.navNextButton)}" icon="slim-arrow-right" tabindex="-1" @click=${context.navigateRight}></${scopeTag("ui5-button", tags, suffix)}></div>`; };
const block3 = (context) => { return html`<div class="${classMap(context.classes.navigation)}">${ context.arrows.navigation ? block4(context) : undefined }<div class="ui5-carousel-navigation">${ !context.hidePageIndicator ? block5(context) : undefined }</div>${ context.arrows.navigation ? block9(context) : undefined }</div>`; };
const block4 = (context) => { return html`<${scopeTag("ui5-button", tags, suffix)} arrow-back title="${ifDefined(context.previousPageText)}" class="ui5-carousel-navigation-button ${classMap(context.classes.navPrevButton)}" icon="slim-arrow-left" tabindex="-1" @click=${context.navigateLeft}></${scopeTag("ui5-button", tags, suffix)}>`; };
const block5 = (context) => { return html`${ context.isPageTypeDots ? block6(context) : block8(context) }`; };
const block6 = (context) => { return html`${ repeat(context.dots, (item, index) => item._id || index, (item, index) => block7(item, index, context)) }`; };
const block7 = (item, index, context) => { return html`<div role="img" aria-label="${ifDefined(item.ariaLabel)}" ?active="${item.active}" class="ui5-carousel-navigation-dot"></div>`; };
const block8 = (context) => { return html`<${scopeTag("ui5-label", tags, suffix)}>${ifDefined(context.selectedIndexToShow)}&nbsp;${ifDefined(context.ofText)}&nbsp;${ifDefined(context.pagesCount)}</${scopeTag("ui5-label", tags, suffix)}>`; };
const block9 = (context) => { return html`<${scopeTag("ui5-button", tags, suffix)} arrow-forward title="${ifDefined(context.nextPageText)}" class="ui5-carousel-navigation-button ${classMap(context.classes.navNextButton)}" icon="slim-arrow-right" tabindex="-1" @click=${context.navigateRight}></${scopeTag("ui5-button", tags, suffix)}>`; };


	return block0(context);
};

export default main;
